export default function GetGameData(data) {
    if(data.st === 2){
        const status = data.cl;
    }
    if(data.st === 1) {
        const status = 'Pregame'
    }
    if(data.st === 3) {
        const status = 'Final'
    }
    const GameData = {
        'date': data.gdte,
        'time': data.utctm,
        'city': data.ac,
        'state': data.as,
        'home': data.hls.tn,
        'away': data.vls.tn,
        'status': status
    };

    return GameData;
}
